import React from "react";
import { AuthProvider } from "./AuthContext";
import { LoadingProvider } from "./LoadingContext";
import { LayoutProvider } from "./LayoutContext";
import { ChatProvider } from "./ChatContext";
import { ContactProvider } from "./ContactContext";
import { GroupProvider } from "./GroupContext";
import { ModalProvider } from "./ModalContext";
import { CallProvider } from "./CallContext";
import { ConferenceProvider } from "./ConferenceContext";
import { MainBoxProvider } from "./MainBoxContext";
import { CallHistoryProvider } from "./CallHistoryContext";
import { ParticipantsDrawerProvider } from "./ParticipantsDrawerContext";

const Provider: React.FC = ({ children }) => {
  return (
    <LoadingProvider>
      <AuthProvider>
        <LayoutProvider>
          <MainBoxProvider>
            <ChatProvider>
              <ContactProvider>
                <GroupProvider>
                  <ConferenceProvider>
                    <CallHistoryProvider>
                      <CallProvider>
                        <ModalProvider>
                          <ParticipantsDrawerProvider>
                            <>{children}</>
                          </ParticipantsDrawerProvider>
                        </ModalProvider>
                      </CallProvider>
                    </CallHistoryProvider>
                  </ConferenceProvider>
                </GroupProvider>
              </ContactProvider>
            </ChatProvider>
          </MainBoxProvider>
        </LayoutProvider>
      </AuthProvider>
    </LoadingProvider>
  );
};

export default Provider;
